import React from 'react';
import { Route, BrowserRouter } from 'react-router-dom';
import { Switch } from 'react-dom';
import Home from './pages/Home';
import Empreendedora from './pages/Empreendedora';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={ Home } />
        <Route path="/empreendedora" component={ Empreendedora } />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
